🌈 𝟟𝟘𝕤 ✿
.
Mi inspiración para este proyecto fue esa década donde nada era más lejano que el encierro.
. 
Nada más lejano que la imposibilidad de tocar los cuerpos, de sentirse libre, de ser calentado por la acción del Sol sobre la piel.
.
Los cuerpos sobre el pasto, 
los jóvenes haciendo tendencia más que nunca el DIY, 
el reciclaje, la personalización de las prendas,
abrazando el propio cuerpo y buscando la armonía bajo el Sol ☀️
.
Hoy parecen pesar más que nunca esos 30 años que nos separan de esa época. 🥀
En un contexto de encierro, de falta de encuentro, de contacto con los otros, y de encuentro con nosotros en la nada misma de la naturaleza. 🍃 
.
Por eso traerla, para recordarla y quizás rozarla así aunque sea en las ideas, en el imaginario colectivo, para sentirse un poco más cerca de ese ensueño idealista de la juventud todo poderosa y el posible mundo ideal. ❤️
.
Y mi musa que disparó ese recuerdo: ʀᴇʙᴇᴄᴄᴀ ᴘᴇᴀʀꜱᴏɴ representada por @mandymooremm ✨
.
